        require(amount > 0, "Must deposit at least one token");

        token.transferFrom(msg.sender, address(this), amount);
        poolBalance = poolBalance + amount;
    }

    function airdrop() public {
        require(!airdroped);
        airdroped = true;
        poolBalance -= 1 ether;
        token.transfer(msg.sender, 1 ether);
    }

